//pixel function
var pixel = function(x, y, color, outline, pickleSize){
fill(color);
if (outline) {
stroke(0, 0, 0);
}
else {noStroke();}
rect(x*pickleSize, y*pickleSize, pickleSize, pickleSize);
};

//Function that loads your amazing pixel art
var loadArt = function (art, x, y, liny, size, img) {

this.colorString = art.colorString;
this.pallet = art.pallet;


if (liny === true) {stroke(0, 0, size, 0);}
else{noStroke();}
pushMatrix();
translate(x, y);


if(!img){
for (var y = this.colorString.length; y--;){

for (var x = this.colorString[y].length; x--;){
if(this.colorString[y][x]!==" "){
pixel(x, y, this.pallet[this.colorString[y][x]], liny, size);
}
}
}
}
else{
    if(img === 1){
for (var y = this.colorString.length; y--;){

for (var x = this.colorString[y].length; x--;){

if(this.colorString[y][x]!==" "){

pixel(x, y, color(255, 255, 255), liny, size);
}
}
}
}

else{
    if (img === 2){

        for (var y = this.colorString.length; y--;){

for (var x = this.colorString[y].length; x--;){

if(this.colorString[y][x]!==" "){

pixel(x, y, color(alpha(this.pallet[this.colorString[y][x]])), liny, size);
}
    }
}
}
}
}
popMatrix();
};

var saveArtAsGraphic = function(target, size, colors, c_index, dummy, dummy2){
c_index = 0;

for (var y = target.colorString.length; y--;){
    c_index = max(c_index, target.colorString[y].length);
}
background(255, 255, 255);
loadArt(target, 0, 0, false, size, false);

dummy = get(0, 0, c_index*size, target.colorString.length*size);

background(0, 0, 0);

loadArt(target, 0, 0, false, size, 2);
dummy2 = get(0, 0, c_index*size, target.colorString.length*size);

dummy.mask(dummy2);

background(255, 255, 255);
numImgsLoaded ++;
return(dummy);
};



